import { Router } from '@angular/router';


@Component({
  selector: 'app-welcome',
  templateUrl: './welcome.component.html',
  styleUrls: ['./welcome.component.scss']
})
export class WelcomeComponent implements OnInit {
  constructor(
    private router: Router
  ) {

  }

  async ngOnInit() {

  }
}
<div class="conteudo__artigo">
  <section class="conteudo__artigo__texto">
    <h2 class="conteudo__artigo__texto__titulo">Alimentação Saudável</h2>
    <p class="conteudo__artigo__texto__paragrafo">A alimentação saudável é rica em nutrientes, vitaminas
      e minerais essenciais para o nosso corpo.</p>
    <a class="botao" href="./artigos/alimentacao_saudavel.html">Saiba mais</a>
  </section>
  <img class="conteudo__artigo__img" src="./img/comida.png" alt="Pessoas em volta de uma mesa com comida">
</div>

<div class="conteudo__artigo">
  <img class="conteudo__artigo__img" src="./img/caminhada.png" alt="Pessoa caminhando">
  <section class="conteudo__artigo__texto">
    <h2 class="conteudo__artigo__texto__titulo">Atividade Física Regular</h2>
    <p class="conteudo__artigo__texto__paragrafo">Benefícios do exercício físico regular para a saúde
      cardiovascular, mental e geral.</p>
    <a class="botao" href="./artigos/atividade_fisica.html">Saiba mais</a>
  </section>
</div>
